import React from "react";
import Card from "./Card";

const DropDown = ({ selectChange, robots }) => {
    return (
        <div>
                <div>
                    {
                        robots.map((user, i) => {
                            return (
                                <Card key={i}
            id={robots[i].id}
            name={robots[i].name}
            email={robots[i].email} />
            );

                        })
                    }
                </div>
        </div>
    );
}

export default DropDown;
